landon is a collection of heavily unit and integration tested tooling, data structures and methods for exporting data (such as meshes and armatures) from blender preparing it for your rendering pipeline. A typical landon workflow involves running the mesh/armature data export scripts (optionally supplemented with your own Python scripts) from Blender via the CLI or Rust API. All export scripts write json stdout. landon provides APIs to parse this data from stdout into Rust structs - but you can also read the JSON output yourself if you don't use Rust. // Parsing exported landon data via the Rust API.
// Rust is not required - you can read the exported JSON data with any programming language.
let meshes = blender_mesh::parse_meshes_from_blender_stdout(&blender_stdout).unwrap();
let armatures = blender_armature::parse_armatures_from_blender_stdout(&blender_stdout).unwrap();
